import React from 'react';
import { streams } from '../data';

const Streams = () => {
  return (
    <div>
      <h1>Streams Page</h1>
     {streams.map((stream,index) => (
      <div key= {index}>
          <h3>Name: {stream.name}</h3>
          </div>
      ))}
      </div>
  )
};

export default Streams;
